import React, { Component } from "react";

export default class ProductList extends Component {
  render() {
    return (
      <React.Fragment>
        <ProductConsumer>
          {value => {
            return value.products.map(product => {
              return <Product product={product} key={id.product} />;
            });
          }}
        </ProductConsumer>
      </React.Fragment>
    );
  }
}
